import React, {Component} from 'react';
import FlightServices from "../../../services/FlightServices";


class DepartureFlightComponent extends Component {

    constructor(props) {
        super(props);

        this.state = {
            departureFlights: []
        }
    }

    componentDidMount() {
        FlightServices.getDepartureFlight().then((response => {
            this.setState({departureFlights: response.data})
            console.log(response.data);
        }));
    }

    render() {
        return (
            < div>
        <h2 className="text-center">Employees List</h2>
        <div className="row">
            <button className="btn btn-primary" onClick={this.addEmployee}>Add Employee</button>
        </div>
        <div className="row">
            <table className="table table-striped table-bordered">
                <thead>
                <tr>
                    <th>Employee First Name</th>
                    <th>Employee Last Name</th>
                    <th>Employee Email Id</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {
                    this.state.employees.map(
                        employee =>
                            <tr key={employee.id}>
                                <td>{employee.firstName}</td>
                                <td>{employee.lastName}</td>
                                <td>{employee.email}</td>
                                <td>
                                    <button onClick={() => this.editEmployee(employee.id)}
                                            className="btn btn-info">Update
                                    </button>
                                    <button onClick={() => this.deleteEmployee(employee.id)}
                                            className="btn btn-danger" style={{marginLeft: "10px"}}>Delete
                                    </button>
                                    <button onClick={() => this.viewDetailsEmployee(employee.id)}
                                            className="btn btn-info" style={{marginLeft: "10px"}}>View Details
                                    </button>
                                </td>
                            </tr>
                    )
                }
                </tbody>
            </table>
        </div>
    </div>
        );
    }
}

export default DepartureFlightComponent;
